import React, { useState, useEffect } from "react";
import api from "../api";
import { Link } from "react-router-dom";

function Edit() {
    const [id, setId] = useState("");
    const [contatoNome, setNome] = useState("");
    const [contatoEmail, setEmail] = useState("");
    const [contatoTelefone, setTelefone] = useState("");

    const handleSubmit = (e) =>{
        e.preventDefault();
        const editContatos = {
            nome: contatoNome,
            email: contatoEmail,
            telephone: contatoTelefone
        }
        editContatos(editContatos);
        setId("");
        setNome("");
        setEmail("");
        setTelefone("");

    }
    async function editContato(editContatos) {
        console.log(id);
        const response = await api.put("/contatos/" + id, editContatos);
    
      }
  return (
    <div>
      <form onSubmit={handleSubmit}>
        <Link to="/" id="botao-pagina-insert">
          <button type="button" className="botao-voltar-insert">
            Voltar
          </button>
        </Link>
        <ul className="ul-insert">
        <li>
            <input
              onChange={(value) => setId(value.target.value)}
              value={id}
              className="input-insert"
              type="number"
              placeholder="Id"
              id="id"
            ></input>
          </li>
          <li>
            <input
              onChange={(value) => setNome(value.target.value)}
              value={contatoNome}
              className="input-insert"
              type="text"
              placeholder="Nome"
              id="nome"
            ></input>
          </li>
          <li>
            <input
              onChange={(value) => setEmail(value.target.value)}
              value={contatoEmail}
              className="input-insert"
              type="text"
              placeholder="Email"
              id="email"
            ></input>
          </li>
          <li>
            <input
              onChange={(value) => setTelefone(value.target.value)}
              value={contatoTelefone}
              className="input-insert"
              type="text"
              placeholder="Telefone"
              id="telephone"
            ></input>
          </li>
          <li>
            <button
              id="botao-form-confirmar-insert"
              type="submit"
              className="input-insert"
            >
              Edit
            </button>
          </li>
        </ul>
      </form>
    </div>
  );
}
export default Edit;
